import React from 'react';
import { NavLink } from 'react-router-dom';
import s from './Navbar.css';

const Navbar = () => {
	return(
    <div className="nav-bar">
      <div className={s.hamburger_menu}>
        <input id="menu__toggle" type="checkbox" />
        <label className="menu__btn" for="menu__toggle">
          <span></span>
        </label>
        <div className="menu__box">
          <div><NavLink className="menu__item" to="/leagues">Лиги</NavLink></div>
          <div><NavLink className="menu__item" to="/leagueSchedule">Расписание лиги</NavLink></div>
          <div><NavLink className="menu__item" to="/teams">Команды</NavLink></div>
          <div><NavLink className="menu__item" to="/teamSchedule">Расписание команды</NavLink></div>
        </div>
      </div>
    </div>
    )
}

export default Navbar;
